import React, { createContext } from 'react';
import {
  BrowserRouter as Router,
} from "react-router-dom";
import {
  Arwes,
  SoundsProvider,
  ThemeProvider as ArwesThemeProvider,
  createSounds,
  createTheme,
} from "arwes";

import AppLayout from "./pages/AppLayout";
import { theme, resources, sounds } from "./settings";

const ThemeContext = createContext(createTheme(theme));

const App = () => {
  return (
    <ThemeContext.Provider value={createTheme(theme)}>
      <ArwesThemeProvider theme={createTheme(theme)}>
        <SoundsProvider sounds={createSounds(sounds)}>
          <Arwes animate background={resources.background.large} pattern={resources.pattern}>
            {anim => (
              <Router>
                <AppLayout show={anim.entered} />
              </Router>
            )}
          </Arwes>
        </SoundsProvider>
      </ArwesThemeProvider>
    </ThemeContext.Provider>
  );
};

export default App;

